import React from 'react';
import styled from 'styled-components';
import LineHour from './LineHour';

const ContainerHours = styled.div`
  margin-top: 60px;
  margin-left: 30px;
  height: 1800px;
  width: 400px;
`;

const DateMonth = () => {
  return (
      <ContainerHours>
          <LineHour text="GMT-06" typeHour={true}></LineHour>
          <LineHour text="1 AM" typeHour={false}></LineHour>
          <LineHour text="2 AM"></LineHour>
          <LineHour text="3 AM"></LineHour>
          <LineHour text="4 AM"></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
          <LineHour></LineHour>
      </ContainerHours>
  )
}

export default DateMonth;
